import React from "react";
import { motion } from "framer-motion";
import { FaEnvelope, FaPhone, FaLinkedin, FaGithub } from "react-icons/fa";
import myProfile from "../src/img/myProfile.JPG";

export default function Portfolio() {
  // Animation Variants for reusability
  const fadeInUp = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.8, ease: "easeOut" },
  };

  const staggerChildren = {
    animate: {
      transition: {
        staggerChildren: 0.2,
      },
    },
  };

  return (
    <section className="min-h-screen bg-gradient-to-b from-gray-50 to-gray-100 flex items-center py-16">
      <div className="container mx-auto px-4 sm:px-6 lg:px-8 flex flex-col-reverse lg:flex-row items-center justify-between gap-12">
        {/* Left Section */}
        <motion.div
          className="w-full lg:w-3/5 text-center lg:text-left"
          variants={staggerChildren}
          initial="initial"
          animate="animate"
        >
          <motion.h1
            className="text-4xl sm:text-5xl lg:text-6xl font-extrabold mb-4 text-gray-900 tracking-tight"
            variants={fadeInUp}
          >
            Chiranjeevi Kumar
          </motion.h1>
          <motion.p
            className="text-lg sm:text-xl italic text-gray-600 mb-4"
            variants={fadeInUp}
          >
            <span className="font-semibold text-green-600">Mobile Developer</span> | React Native | Swift | Kotlin
          </motion.p>
          <motion.p
            className="text-base sm:text-lg text-gray-700 mb-8 leading-relaxed max-w-2xl"
            variants={fadeInUp}
          >
            Passionate about crafting seamless, high-performance mobile applications. Specializing in{" "}
            <span className="font-semibold">iOS & Android development</span>, API integrations, and UI/UX optimization.
          </motion.p>

          {/* Skills & Projects */}
          <motion.div className="space-y-6 mb-8" variants={fadeInUp}>
            <p className="text-base sm:text-lg text-gray-600">
              <span className="font-semibold">Key Skills:</span> React Native, Swift, Kotlin, Firebase, REST APIs, GraphQL, Redux, TailwindCSS, Payment Integration
            </p>
            <div>
              <p className="font-semibold text-gray-700">Recent Projects:</p>
              <ul className="mt-2 space-y-2 text-gray-600 text-base sm:text-lg">
                <li>üöó <span className="font-medium">EV Charging App:</span> Real-time station availability & payments</li>
                <li>üè¶ <span className="font-medium">Fintech Wallet:</span> Secure transactions with biometric authentication</li>
                <li>üõçÔ∏è <span className="font-medium">E-commerce App:</span> Smooth checkout with Stripe integration</li>
              </ul>
            </div>
          </motion.div>

          {/* Button */}
          <motion.a
            href="#contact"
            className="inline-flex items-center px-6 py-3 bg-green-600 text-white font-semibold rounded-full shadow-lg hover:bg-green-700 transition-all duration-300 hover:scale-105"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            variants={fadeInUp}
          >
            Let‚Äôs Collaborate <span className="ml-2 text-orange-400">üöÄ</span>
          </motion.a>

          {/* Contact Info */}
          <motion.div
            className="mt-8 flex flex-col sm:flex-row gap-6 justify-center lg:justify-start"
            variants={staggerChildren}
          >
            <motion.a
              href="tel:+917870503085"
              className="flex items-center gap-3 text-gray-700 hover:text-green-600 transition-all"
              variants={fadeInUp}
            >
              <FaPhone className="text-green-600" />
              <span className="font-medium text-sm sm:text-base">+91 7870503085</span>
            </motion.a>
            <motion.a
              href="mailto:chiranjeeviraj109@gmail.com"
              className="flex items-center gap-3 text-gray-700 hover:text-green-600 transition-all"
              variants={fadeInUp}
            >
              <FaEnvelope className="text-green-600" />
              <span className="font-medium text-sm sm:text-base">chiranjeeviraj109@gmail.com</span>
            </motion.a>
          </motion.div>

          {/* Social Links */}
          <motion.div
            className="mt-6 flex gap-6 justify-center lg:justify-start"
            variants={staggerChildren}
          >
            <motion.a href="#" className="text-gray-600 hover:text-green-600 transition-all text-2xl" variants={fadeInUp}>
              <FaLinkedin />
            </motion.a>
            <motion.a href="#" className="text-gray-600 hover:text-green-600 transition-all text-2xl" variants={fadeInUp}>
              <FaGithub />
            </motion.a>
          </motion.div>
        </motion.div>

        {/* Profile Image */}
        <motion.div
          className="relative w-48 h-48 sm:w-64 sm:h-64 lg:w-80 lg:h-80 flex-shrink-0"
          initial={{ scale: 0.8, opacity: 0 }}
          animate={{ scale: 1, opacity: 1 }}
          transition={{ duration: 1, ease: "easeOut" }}
        >
          <div className="relative w-full h-full rounded-full overflow-hidden shadow-xl ring-4 ring-green-200">
            <img src={myProfile} alt="Chiranjeevi Kumar" className="w-full h-full object-cover" />
            <div className="absolute inset-0 bg-gradient-to-br from-green-500/20 to-blue-500/20"></div>
          </div>
          {/* Decorative Floating Dot */}
          <motion.div
            className="absolute -top-4 -right-4 w-6 h-6 bg-green-500 rounded-full"
            animate={{ y: [0, -10, 0], scale: [1, 1.2, 1] }}
            transition={{ duration: 2, repeat: Infinity, ease: "easeInOut" }}
          />
        </motion.div>
      </div>
    </section>
  );
}
